public void xor(FixedBitSet other) {
  final long[] thisBits = this.bits;
  final long[] otherBits = other.bits;
  int pos = Math.min(wordLength, other.wordLength);
  while (--pos >= 0) {
    thisBits[pos] ^= otherBits[pos];
  }
}

